import React, { Component } from 'react'; // let's also import Component
import { CreateButton } from './createPromotions';
import { Grid } from '@material-ui/core';

export class Home extends Component {
  render() {

    return
    <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justify="center"
      style={{ minHeight: '100vh' }}
    >

      <Grid item xs={3}>
        <LoginForm />
      </Grid>

    </Grid>
  }
}
